import React from 'react';
import "./App.css";
import Title from "./components/Title";
import ProjectGrid from "./components/ProjectGrid";

function App() {
  return (
    <div classname="App">
      <center>
        <Title />
      </center>
      <ProjectGrid />
    </div>
  );
}

export default App;
